(Collectively "Distributor')

"Zebra" and the "Distributor" are referred to collectively as 'Parties" and individually as a "Party".

WHEREAS: (A) On February 12, 2014 the Parties entered into an agreement that was renamed, as of April 11, 2016, to: PartnerConnectTM EVM Distribution Agreement, (as amended) ("Distribution Agreement"), which relates to Zebra Enterprise Visibility and Mobility ('EVM") products and services, and which, as acknowledged by the Parties by entering into this Amendment, is in full force and effect and valid as when this Amendment is executed;

(B) Distributor purchases Products from Zebra under the Distributor Agreement;

(C)​ Zebra has recently completed the acquisition of Xplore, which transaction closed on August 14, 2018;

(D) Zebra has expanded its products portfolio by adding the product families listed in Exhibit A, that as of the Effective Date hereof are branded Xplore or Motion Computing, thereto ("Xplore Products"); (E) Xplore, now a Zebra Affiliate, is the seller of Xplore Products;

Source: SCANSOURCE, INC., 10-Q, 5/9/2019





(F) Xplore wishes to sell Xplore Products to Distributor and Distributor wishes to purchase such products from Xplore pursuant to the terms and conditions of the Distributor Agreement by entering into this Addendum; and

(G) The Parties desire to amend the Distributor Agreement by adding Xplore Products and authorizing Distributor to purchase such products from Xplore for further resale to members of the Zebra PartnerConnect Program in the Market or Territory.

Boyd Enterprises, LLC, a Texas limited liability company, whose principal  place of business is located at 2003 Navasota Cove, Westlake, Texas, referred to in this Agreement as "Company" or "Boyd", and Cano Petroleum,  Inc., a Delaware corporation qualified to transact business in Texas, whose principal place of business is located at 801 Cherry Street, Suite 3200,  Fort Worth, Texas 76102, referred to in this agreement as "Sponsor" or "Cano".

WHEREAS, the Company is the owner of the rights to the television production known as Honey Hole (hereinafter "Honey Hole" or "Show");

WHEREAS, Sponsor desires to acquire the exclusive right to be the lead sponsor of the Show at an agreed price and under specified terms and  conditions;

NOW, THEREFORE, for and in consideration of the premises and the mutual promises, covenants, and agreements set forth in this Agreement, the  Company and Cano agree as follows:

